// Review.tsx
import React from 'react';
import './reviews.css';

interface ReviewProps {
  text: string;
  photo: string;
}

const Review: React.FC<ReviewProps> = ({ text, photo }) => {
  return (
    <div className="review-item">
      <img src={photo} alt="Review" className="review-photo" />
      <p>{text}</p>
    </div>
  );
};

export default Review;
